import React, { useState } from 'react';

import { Form, Input, Button } from 'antd';
import RadInput from './RadioInput';
import { Conteudo } from './style';
import {questoes} from './questionario';
import Painel from '../../../components/Painel/index';


export default function Relatorio(){
    const [usuario, setUsuario] = useState('Carlos');
    return(
        <Painel btns={['Perfil', 'Relat贸rio', 'Hist贸rico', 'Sair']}>
            <Conteudo>
                <Form
                    layout="vertical"
                > 
                    {questoes.map((item)=>
                        item.tipo==="texto" ? 
                        <Form.Item label={item.questao} name={item.numero} rules={item.regra}>
                            <Input.TextArea></Input.TextArea>
                        </Form.Item>:
                        <Form.Item label={item.questao} name={item.numero} rules={item.regra}>
                            <RadInput opcoes={item.opcoes}></RadInput>
                        </Form.Item>
                    )}
                    <Form.Item>
                        <Button type="primary" htmlType="submit">
                            Submit
                        </Button>
                    </Form.Item>
                </Form>
            </Conteudo>
        </Painel>
    );
}
